import './Profile.scss';
import Main from '../image/main.jpg'

function App() {
  return (
    <div className="profile">
      <div className='profile__wrap'>
        <img src={Main} className="profile__image" alt="aura" width={200} />
      </div>
      <div>
        <h2 className='profile__title'>自己紹介</h2>
        <p>
          東京在住のコーダーです。<br/>
          基本的に在宅勤務なので、運動不足解消のため始めたヨガにハマりもう3年近くやってます。<br/>
          漫画やアニメも好きで、作業時のBGMはアニソン、ボカロです。<br/><br/>
          京都の美大を卒業後、都内IT企業に就職してから1年目はバナーデザインなど行なっていました。2年目以降はコーディングがメイン業務となり7年目になりました。<br/>
          最近はアクセシビリティ対応を進めてます。
        </p>
      </div>
    </div>
  );
}

export default App;
